var tipuesearch = {"pages": [{'title': 'About', 'text': 'http://mde.tw/cp2019 \xa0\xa0 \n \n https://dartpad.dev?id=0ae5a8ccaf26f9c6643a6ec7e3d6c460 \n https://gist.github.com/40823232/0ae5a8ccaf26f9c6643a6ec7e3d6c460 \n', 'tags': '', 'url': 'About.html'}, {'title': 'w5', 'text': "原始碼: \n void main() {\n  for (var i = 0; i < 4; i++) {\n    print('hello $i');\n  }\n} \n https://gist.github.com/40823232/e150241f55afc828049865912c74ca0c \n http://mde.tw/dartpad/?id=215ba63265350c02dfbd586dfd30b8c3 \n", 'tags': '', 'url': 'w5.html'}, {'title': 'w6', 'text': 'hello原始碼: \n main() {\n  for (int i = 0; i < 5; i++) {\n    print(\'hello $i\');\n  }\n  print(\'hello 中文\');\n} \n \xa0for迴圈原始碼: \n int i;\nint sum;\n\nmain(){\n  sum = 0;\n  for (i=1;i <= 10 ; i++){\n    sum += i;\n    print("$sum");\n  }\n  print(\'sum = $sum\');\n}\n\nfun1(){\n} \n \n https://gist.github.com/40823232/de2ba740a07a068fc5427ff7cfac3813 \n https://dartpad.dev?id=0ae5a8ccaf26f9c6643a6ec7e3d6c460 \n', 'tags': '', 'url': 'w6.html'}, {'title': 'w7', 'text': 'sum原始碼: \n int i;\nint start=1;\nint end=10;\nint sum;\n  \nvoid main() {\n  sum = 0;\n  for ( i = start; i <= end; i++) {\n    //print(\'目前累加值為 $i\');\n    sum += i;\n  }\n  print("從 $start 累加至 $end 總數為 $sum");\n} \n', 'tags': '', 'url': 'w7.html'}, {'title': 'w8', 'text': '\xa0阻尼係數 \n \n W8 <<  Previous   \n', 'tags': '', 'url': 'w8.html'}, {'title': 'W10', 'text': '純 Dart 程式 \n Hello   For Loop   Sum   Runge-Kutta   RK ex1   Mass Spring Damping \n Html 程式 \n ROC Flag   Grid   X-Y Plot   Slithery \n Flutter 程式 \n Flutter1   Flutter2   Flutter3 \n 攝氏與華氏的轉換 \n CF \n forCF    內建放入的 Dart 原始碼  \n 放大   回復 \n \n W8 <<  Previous \n', 'tags': '', 'url': 'W10.html'}, {'title': 'W12', 'text': '\n \n', 'tags': '', 'url': 'W12.html'}, {'title': 'course', 'text': 'Course \n 此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules \xa0 https://github.com/mdecourse/newcms.git v \n \n', 'tags': '', 'url': 'course.html'}]};